import * as React from 'react';
import { StyleSheet, SafeAreaView, View, Text, TouchableOpacity, TextInput, Button, ImageBackground } from 'react-native';
import Constants from "expo-constants";
import { IconButton, Colors } from 'react-native-paper';

export default function Home({ navigation }) {

    const Temperature = () => {
        navigation.navigate('Temperature')
    }

    const Light = () => {
        navigation.navigate('Light')
    }

    const AirQuality = () => {
        navigation.navigate('AirQuality')
    }

  return (
    <SafeAreaView>
      <View>
        <Text>List of sensors:</Text>
        <View>
          <Button
              onPress={Temperature}
              title="Temperature"
              color="#841584"
              accessibilityLabel="Learn more about this purple button"
          />
        <View>
        </View>
          <Button
              onPress={Light}
              title="Light"
              color="#841584"
              accessibilityLabel="Learn more about this purple button"
          />
        <View>
        </View>
          <Button
              onPress={AirQuality}
              title="Air Quality"
              color="#841584"
              accessibilityLabel="Learn more about this purple button"
          />
        </View>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#000",
    paddingTop: Constants.statusBarHeight,
    opacity: 1,
  },
});
